function Icon(props: IIconProps) {
  const defaultSize = 24;
  const size = props.size ?? defaultSize;
  let containerSize = null as Size | null;
  if (props.containerSize) {
    if (typeof props.containerSize === "number") {
      containerSize = {
        width: props.containerSize,
        height: props.containerSize,
      };
    } else {
      containerSize = props.containerSize;
    }
  }

  // we can path size as object if we need to change svg width/height
  // in case if it is more the 24 px of it is not square
  const wi = typeof size === "number" ? size : size.width;
  const he = typeof size === "number" ? size : size.height;
  return (
    <div
      className={classNames("Icon", props.className)}
      style={{
        minWidth: containerSize ? containerSize.width : wi,
        minHeight: containerSize ? containerSize.height : he,
        width: containerSize ? containerSize.width : wi,
        height: containerSize ? containerSize.height : he,
      }}
    >
      <svg
        width="100%"
        height="100%"
        viewBox={`0 0 ${props.viewBoxSize ?? 16} ${props.viewBoxSize ?? 16}`}
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        {props.icon}
      </svg>
    </div>
  );
}

export default Icon;
